import React from 'react';
import { Link } from 'react-router-dom';

const ProviderDashboard = () => {
  // We'll fetch real requests from backend later
  const helpRequests = [
    { id: 1, location: "Trichy", issue: "Flat tire" },
    { id: 2, location: "Chennai", issue: "Engine overheating" }
  ];

  return (
    <div className="container mt-5">
      <h2>Service Provider Dashboard</h2>
      <p>List of help requests submitted by users:</p>
      <ul className="list-group">
        {helpRequests.map(request => (
          <li key={request.id} className="list-group-item">
            <strong>Location:</strong> {request.location} | <strong>Issue:</strong> {request.issue}
          </li>
        ))}
      </ul>
      <Link to="/" className="btn btn-secondary mt-3">Logout</Link>
    </div>
  );
};

export default ProviderDashboard;
